import './project-tab-content.scss';

import React from 'react';
import Modal from 'react-modal';
import ProjectTabContent from './project-tab-content';

const ProjectTabContentModal = ({ isOpen, name, src, description }) => (
    <Modal
      className="project-tab-content-modal"
      isOpen={isOpen}>
        <ProjectTabContent
          name={name}
          src={src}
          description={description}
        />
    </Modal>
);

export default ProjectTabContentModal;
